import { BrowserRouter, Routes, Route } from "react-router-dom";
import Messages from "./Messages/Messages";
import Profile from "./Profile/Profile";

const Content = (props) => {
  return (
      <Routes>
        <Route path="/messages/*" element={<Messages messageData = {props.store.state.messageData} dialogData = {props.store.state.dialogData}/>} />
        <Route path="/profile/*" element={<Profile postData = {props.store.state.postData} addPost={props.store.addPost.bind(props.store)} postTextChange={props.store.postTextChange} />} />
      </Routes>
  );
}

export default Content;
